s-->\n\n        <!--Components as content starts-->\n        <div class=\"col-sm-12 col-md-6 col-lg-4\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <div class=\"card-title-wrap bar-warning\">\n                        <h4 class=\"card-title\">Components as content</h4>\n                    </div>\n                    <p>You can pass an existing component as content of the modal window. In this case remember to add content\n                        component as an\n                        <code>entryComponents</code> section of your\n                        <code>NgModule</code>.</p>\n                </div>\n                <div class=\"card-body\">\n                    <div class=\"card-block\">\n                        <button class=\"btn btn-lg btn-outline-primary\" (click)=\"openContent()\">Launch demo modal</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Components as content ends-->\n\n        <!--Modal with custom class starts-->\n        <div class=\"col-sm-12 col-md-6 col-lg-4\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <div class=\"card-title-wrap bar-primary\">\n                        <h4 class=\"card-title\">Modal with custom class</h4>\n                    </div>\n                    <p>With some style and dark window modal.</p>\n                </div>\n                <div class=\"card-body\">\n                    <div class=\"card-block\">\n                        <ng-template #customContent let-c=\"close\" let-d=\"dismiss\">\n                            <div class=\"modal-header\">\n                                <h4 class=\"modal-title\">Modal title</h4>\n                                <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"d('Cross click')\">\n                                    <span aria-hidden=\"true\">&times;</span>\n                     