module.exports = "<!--Popover Starts-->\n<section id=\"popovers\">\n  <div class=\"row\">\n    <div class=\"col-sm-12\">\n      <div class=\"content-header\">Popovers</div>\n    </div>\n  </div>\n  <div class=\"row\" matchHeight=\"card\">\n    <!--Quick and easy popovers Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Quick and easy popovers</h4>\n          </div>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <button type=\"button\" class=\"btn btn-outline-primary mr-1 mb-1\" placement=\"right\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              popoverTitle=\"Popover on right\">\n              Popover on right\n            </button>\n\n            <button type=\"button\" class=\"btn btn-outline-danger mr-1 mb-1\" placement=\"top\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              popoverTitle=\"Popover on top\">\n              Popover on top\n            </button>\n\n            <button type=\"button\" class=\"btn btn-outline-info mr-1 mb-1\" placement=\"bottom\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              popoverTitle=\"Popover on bottom\">\n              Popover on bottom\n            </button>\n\n            <button type=\"button\" class=\"btn btn-outline-warning mr-1 mb-1\" placement=\"left\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              popoverTitle=\"Popover on left\">\n              Popover on left\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Quick and easy popovers Ends-->\n\n    <!--HTML and bindings in popovers Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-warning\">\n            <h4 class=\"card-title\">HTML and bindings in popovers</h4>\n          </div>\n          <p>Popovers can contain any arbitrary HTML, Angular bindings and even directives! Simply enclose desired content in\n            a\n            <code>&lt;template&gt;</code> element.</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <ng-template #popContent>Hello,\n              <b>{{name}}</b>!</ng-template>\n            <button type=\"button\" class=\"btn btn-outline-success btn-sm\" [ngbPopover]=\"popContent\" popoverTitle=\"Fancy content\">\n              I've got markup and bindings in my popover!\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--HTML and bindings in popovers Ends-->\n  </div>\n  <div class=\"row\" matchHeight=\"card\">\n    <!--Custom and manual triggers Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-primary\">\n            <h4 class=\"card-title\">Custom and manual triggers</h4>\n          </div>\n          <p>You can easily override open and close triggers by specifying event names (separated by\n            <code>:</code>) in the\n            <code>triggers</code> property.</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <button type=\"button\" class=\"btn btn-outline-primary\" ngbPopover=\"You see, I show up on hover!\" triggers=\"mouseenter:mouseleave\"\n              popoverTitle=\"Pop title\">\n              Hover over me!\n            </button>\n            <p class=\"pt-3\">\n              Alternatively you can take full manual control over popover opening / closing events.\n            </p>\n            <button type=\"button\" class=\"btn btn-outline-info mr-1\" ngbPopover=\"What a great tip!\" triggers=\"manual\" #p=\"ngbPopover\"\n              (click)=\"p.open()\" popoverTitle=\"Pop title\">\n              Click me to open a popover\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-warning\" (click)=\"p.close()\">\n              Click me to close a popover\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Custom and manual triggers Ends-->\n\n    <!--Append popover in the body Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-danger\">\n            <h4 class=\"card-title\">Append popover in the body</h4>\n          </div>\n          <p> Set the\n            <code>container</code> property to \"body\" to have the popover be appended to the body instead of the triggering element's parent. This\n            option is useful if the element triggering the popover is inside an element that clips its contents (i.e.\n            <code>overflow: hidden</code>).</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <div class=\"mb-0\" style=\"padding: 20px 0; text-align: center; overflow:hidden\">\n              <button type=\"button\" class=\"btn btn-outline-success btn-sm mr-1\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n                container=\"body\">\n                Popover appended to body\n              </button>\n              <button type=\"button\" class=\"btn btn-outline-danger btn-sm\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\">\n                Default popover\n              </button>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Append popover in the body Ends-->\n  </div>\n  <div class=\"row\" matchHeight=\"card\">\n    <!--Context and manual triggers Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-info\">\n            <h4 class=\"card-title\">Context and manual triggers</h4>\n          </div>\n          <p> You can optionally pass in a context when manually triggering a popover.</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <ng-template #popContent let-greeting=\"greeting\">{{greeting}},\n              <b>{{name}}</b>!</ng-template>\n            <p>\n              How would you like to greet\n              <strong [ngbPopover]=\"popContent\" popoverTitle=\"Greeting\" #x=\"ngbPopover\" triggers=\"manual\">me</strong>?\n            </p>\n            <button type=\"button\" class=\"btn btn-outline-warning mr-1\" (click)=\"changeGreeting({ greeting: 'Bonjour' })\">\n              French\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-info mr-1\" (click)=\"changeGreeting({ greeting: 'Gutentag' })\">\n              German\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-danger mr-1\" (click)=\"changeGreeting({ greeting: 'Hello' })\">\n              English\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Context and manual triggers Ends-->\n\n    <!--Popover visibility events Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Popover visibility events</h4>\n          </div>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <button type=\"button\" class=\"btn btn-outline-primary\" placement=\"top\" ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              popoverTitle=\"Popover on top\" #popover=\"ngbPopover\">\n              Open Popover\n            </button>\n\n            <p class=\"pt-3\">\n              Popover is currently:\n              <code>{{ popover.isOpen() ? 'open' : 'closed' }}</code>\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Popover visibility events Ends-->\n  </div>\n</section>\n<!--Popover Starts-->"

