module.exports = "<!--Tooltip Starts-->\n<section id=\"tooltio\">\n  <div class=\"row\">\n    <div class=\"col-sm-12\">\n      <div class=\"content-header\">Tooltips</div>\n    </div>\n  </div>\n  <div class=\"row\">\n    <!--Quick and easy tooltips Starts-->\n    <div class=\"col-md-12 col-lg-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Quick and easy tooltips</h4>\n          </div>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <button type=\"button\" class=\"btn btn-outline-primary mr-1 mb-1\" placement=\"top\" ngbTooltip=\"Tooltip on top\">\n              Tooltip on top\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-warning mr-1 mb-1\" placement=\"right\" ngbTooltip=\"Tooltip on right\">\n              Tooltip on right\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-success mr-1 mb-1\" placement=\"bottom\" ngbTooltip=\"Tooltip on bottom\">\n              Tooltip on bottom\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-danger mr-1 mb-1\" placement=\"left\" ngbTooltip=\"Tooltip on left\">\n              Tooltip on left\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Quick and easy tooltips Ends-->\n  </div>\n  <div class=\"row\">\n    <!--HTML and bindings in tooltips Starts-->\n    <div class=\"col-md-12 col-lg-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-warning\">\n            <h4 class=\"card-title\">HTML and bindings in tooltips</h4>\n          </div>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <p>Tooltips can contain any arbitrary HTML, Angular bindings and even directives! Simply enclose desired content\n              in a\n              <code>&lt;template&gt;</code> element.</p>\n\n            <ng-template #tipContent>Hello, <b>{{name}}</b>!</ng-template>\n            <button type=\"button\" class=\"btn btn-outline-primary\" [ngbTooltip]=\"tipContent\">\n              I've got markup and bindings in my tooltip!\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--HTML and bindings in tooltips Ends-->\n  </div>\n  <div class=\"row\">\n    <!--Custom and manual triggers Starts-->\n    <div class=\"col-md-12 col-lg-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-primary\">\n            <h4 class=\"card-title\">Custom and manual triggers</h4>\n          </div>\n          <p> You can easily override open and close triggers by specifying event names (separated by\n            <code>:</code>) in the\n            <code>triggers</code> property.</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <button type=\"button\" class=\"btn btn-outline-success\" ngbTooltip=\"You see, I show up on click!\" triggers=\"click:blur\">\n              Click me!\n            </button>\n\n            <p class=\"pt-3\">\n              Alternatively you can take full manual control over tooltip opening / closing events.\n            </p>\n\n            <button type=\"button\" class=\"btn btn-outline-info mr-2\" ngbTooltip=\"What a great tip!\" triggers=\"manual\" #t=\"ngbTooltip\"\n              (click)=\"t.open()\">\n              Click me to open a tooltip\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-warning\" (click)=\"t.close()\">\n              Click me to close a tooltip\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Custom and manual triggers Ends-->\n  </div>\n  <div class=\"row\">\n    <!--Context and manual triggers Starts-->\n    <div class=\"col-md-12 col-lg-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-danger\">\n            <h4 class=\"card-title\">Context and manual triggers</h4>\n          </div>\n          <p> You can optionally pass in a context when manually triggering a popover.</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\">\n            <ng-template #tipContent let-greeting=\"greeting\">{{greeting}},\n              <b>{{name}}</b>!</ng-template>\n            <p>\n              How would you like to greet\n              <strong [ngbTooltip]=\"tipContent\" #x=\"ngbTooltip\" triggers=\"manual\">me</strong>?\n            </p>\n            <button type=\"button\" class=\"btn btn-outline-primary mr-2\" (click)=\"changeGreeting({ greeting: 'Bonjour' })\">\n              French\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-warning mr-2\" (click)=\"changeGreeting({ greeting: 'Gutentag' })\">\n              German\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-info mr-2\" (click)=\"changeGreeting({ greeting: 'Hello' })\">\n              English\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Context and manual triggers Ends-->\n  </div>\n  <div class=\"row\">\n    <!--Append tooltip in the body Starts-->\n    <div class=\"col-md-12 col-lg-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-info\">\n            <h4 class=\"card-title\">Append tooltip in the body</h4>\n          </div>\n          <p>Set the\n            <code>container</code> property to \"body\" to have the tooltip be appended to the body instead of the triggering element's parent. This\n            option is useful if the element triggering the tooltip is inside an element that clips its contents (i.e.\n            <code>overflow: hidden</code>).</p>\n        </div>\n        <div class=\"card-body\">\n          <div class=\"card-block\" style=\"padding: 50px 0; text-align: center; overflow:hidden\">\n            <button type=\"button\" class=\"btn btn-outline-success\" ngbTooltip=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\">\n              Default tooltip\n            </button>\n            <button type=\"button\" class=\"btn btn-outline-danger\" ngbTooltip=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\"\n              container=\"body\">\n              Tooltip appended to body\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Append tooltip in the body Ends-->\n  </div>\n</section>\n<!--Tooltip Ends-->"

