module.exports = "<div class=\"row\">\n  <div class=\"col-sm-12\">\n    <div class=\"content-header\">Quill Editor</div>\n    <p class=\"content-sub-header\">quill editor with angular and TypeScript. ngx-quill is the new angular 2 and beyond implementation of ngQuill.</p>\n  </div>\n</div>\n<!-- Default Quill Editor starts -->\n<section id=\"quill-editor\">\n  <div class=\"row\">\n    <div class=\"col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Default editor</h4>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div class=\"row\">\n            <div class=\"col-md-12 col-lg-12\">\n              <quill-editor [style]=\"{height: '200px'}\" (onEditorCreated)=\"setFocus($event)\"></quill-editor>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <!-- Default Quill Editor Ends -->\n\n  <!-- Reactive forms Quill Editor starts -->\n  <div class=\"row\">\n    <div class=\"col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-warning\">\n            <h4 class=\"card-title\">Reactive Forms and patch value</h4>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div class=\"row\">\n            <div class=\"col-sm-12\">\n              <form [formGroup]=\"form\">\n                <div class=\"mb-2\">\n                  <button type=\"button\" class=\"btn btn-raised mr-1 btn-primary\" (click)=\"hide=!(!!hide)\">hide / show</button>\n                  <button type=\"button\" class=\"btn btn-raised mr-1 btn-primary\" (click)=\"patchValue()\">patchValue</button>\n                </div>\n                <quill-editor #editor [style.display]=\"hide ? 'none' : 'block'\" formControlName=\"editor\"></quill-editor>\n                <p class=\"mt-2\">\n                  Output : {{form.controls.editor.value}}\n                </p>\n              </form>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <!-- Reactive forms Quill Editor ends -->\n\n  <!-- Quill Editor without toolbar starts -->\n  <div class=\"row\">\n    <div class=\"col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-primary\">\n            <h4 class=\"card-title\">Editor without toolbar + required and ngModule</h4>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div class=\"row\">\n            <div class=\"col-md-12 col-lg-12\">\n              <div class=\"mb-2\">\n                <button (click)=\"toggleReadOnly()\" class=\"btn btn-raised btn-primary\">Toggle ReadOnly</button>\n              </div>\n              <quill-editor [(ngModel)]=\"title\" [maxLength]=\"5\" [minLength]=\"3\" [required]=\"true\" [readOnly]=\"isReadOnly\" [modules]=\"{toolbar: false}\"\n                (onContentChanged)=\"logChange($event);\" (onSelectionChanged)=\"logSelection($event);\"></quill-editor>\n              <p class=\"mt-2\">\n                isReadOnly : {{isReadOnly}}\n                <br> Title : {{title}}\n              </p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <!-- Quill Editor without toolbar ends -->\n</section>"

