module.exports = "<section id=\"switch\">\n  <div class=\"row text-left\">\n    <div class=\"col-sm-12\">\n      <div class=\"content-header\">Angular ng-select</div>\n      <p class=\"content-sub-header\"></p>\n    </div>\n  </div>\n  <div class=\"row text-left\">\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Basic</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"cities\" bindLabel=\"name\" placeholder=\"Select city\" [(ngModel)]=\"selectedCity\">\n            </ng-select>\n            <p>\n              Selected city: {{selectedCity | json}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Multiselect with custom bindings</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"cities2\" bindLabel=\"name\" bindValue=\"id\" [multiple]=\"true\" placeholder=\"Select cities\"\n              [(ngModel)]=\"selectedCityIds\">\n            </ng-select>\n            <p>\n              Selected cities: {{selectedCityIds}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class=\"row text-left\">\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Custom tags</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"users\" bindLabel=\"name\" bindValue=\"id\" [addTag]=\"addCustomUser\" [multiple]=\"true\"\n              placeholder=\"Select user or add custom tag\" [(ngModel)]=\"selectedUserIds\">\n            </ng-select>\n            <p>\n              Selected user: {{selectedUserIds}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Custom templates</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"cities3\" bindLabel=\"name\" bindValue=\"name\" placeholder=\"Select city\" [(ngModel)]=\"selectedCityName\">\n              <ng-template ng-header-tmp>\n                Custom header\n              </ng-template>\n              <ng-template ng-label-tmp let-item=\"item\">\n                <img height=\"15\" width=\"15\" [src]=\"item.avatar\" />\n                <b>{{item.name}}</b> is cool\n              </ng-template>\n              <ng-template ng-option-tmp let-item=\"item\" let-index=\"index\">\n                <img height=\"15\" width=\"15\" [src]=\"item.avatar\" />\n                <b>{{item.name}}</b>\n              </ng-template>\n              <ng-template ng-footer-tmp>\n                Custom footer\n              </ng-template>\n            </ng-select>\n            <p>\n              Selected city: {{selectedCityName}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class=\"row text-left\">\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Virtual scroll</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"cities4\" [virtualScroll]=\"true\" bindLabel=\"name\" bindValue=\"id\" placeholder=\"Select city\"\n              [(ngModel)]=\"selectedCityId\">\n            </ng-select>\n            <p>\n              Selected city ID: {{selectedCityId}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Append dropdown to body</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"cities4\" bindLabel=\"name\" [virtualScroll]=\"true\" bindValue=\"id\" appendTo=\"body\"\n              placeholder=\"Select city\" [(ngModel)]=\"selectedCityId\">\n            </ng-select>\n            <p>\n              Selected city ID: {{selectedCityId}}\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class=\"row text-left\">\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4>Grouping</h4>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ng-select [items]=\"accounts\" bindLabel=\"name\" bindValue=\"name\" groupBy=\"country\" [(ngModel)]=\"selectedAccount\">\n            </ng-select>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n\n    </div>\n\n  </div>\n\n</section>"

