module.exports = "<section id=\"switch\">\n  <div class=\"row\">\n    <div class=\"col-sm-12\">\n      <div class=\"content-header\">Switch</div>\n      <p class=\"content-sub-header\"></p>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Checked</h4>\n            <p class=\"card-subtitle\">Use <code>checked</code> attribute Or <code>[checked]=\"false\"</code>, for default switch.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch checked class=\"mr-1\"></ui-switch>\n            <ui-switch [checked]=\"false\"></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-danger\">\n            <h4 class=\"card-title\">Reverse</h4>\n            <p class=\"card-subtitle\">Use <code>reverse</code> attribute to make it work like reverse switch.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch reverse></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-primary\">\n            <h4 class=\"card-title\">Two way binding</h4>\n            <p class=\"card-subtitle\">For Two way binding switch, use <code>[(ngModel)]=\"enable\"</code>.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch [(ngModel)]=\"enable\"></ui-switch> \n            <p>{{enable}}</p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-warning\">\n            <h4 class=\"card-title\">Change</h4>\n            <p class=\"card-subtitle\">On change event of switch set counter using <code>(change)=\"onChange()\"</code>.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch (change)=\"onChange()\"></ui-switch> \n            <p>change count {{count}}</p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-info\">\n            <h4 class=\"card-title\">Disabled</h4>\n            <p class=\"card-subtitle\">Use <code>disabled</code> attribute Or <code>[disabled]=\"true\"</code>, for disabled switch.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch disabled class=\"mr-1\"></ui-switch>\n            <ui-switch checked [disabled]=\"true\"></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-success\">\n            <h4 class=\"card-title\">Size</h4>\n            <p class=\"card-subtitle\">Use <code>size=\"small\"</code> for small switch and <code>size=\"large\"</code>, for large switch.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch size=\"small\" class=\"mr-1\"></ui-switch>\n            <ui-switch class=\"mr-1\"></ui-switch>\n            <ui-switch size=\"large\"></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div> \n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-danger\">\n            <h4 class=\"card-title\">color</h4>\n            <p class=\"card-subtitle\">Use <code>color</code> attribute to make switch colorful.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch class=\"mr-1\"></ui-switch>\n            <ui-switch color=\"grey\" class=\"mr-1\"></ui-switch>\n            <ui-switch color=\"pink\"></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div>\n    <div class=\"col-xl-6 col-lg-6 col-12\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <div class=\"card-title-wrap bar-primary\">\n            <h4 class=\"card-title\">switchColor</h4>\n            <p class=\"card-subtitle\">Use <code>switchColor</code> attribute to make switch toggle colorful.</p>\n          </div>\n        </div>\n        <div class=\"card-block\">\n          <div>\n            <ui-switch switchColor=\"pink\" class=\"mr-1\"></ui-switch>\n            <ui-switch switchColor=\"grey\" class=\"mr-1\"></ui-switch>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n</section>"

